 `twitter`.','Adds a instagram url input. This can be used by other plugins if the htmlvar remains `instagram`.'=>'Добавляет ввод URL-адреса Instagram. Это может использоваться другими плагинами, если поле остается `instagram`.','Adds a terms and conditions checkbox to your add listing page, the text links to your GD terms and conditions page set in the pages settings.'=>'Добавляет флажок условий и положений на страницу добавления списка, текстовые ссылки на страницу условий и положений GD, заданную в настройках страниц.','You MUST accept our terms and conditions to continue.'=>'Вы ДОЛЖНЫ принять наши условия, чтобы продолжить.','Adds a video url/code input. This can be used by other plugins if the htmlvar remains `video`.'=>'Добавляет URL-адрес видео. Это может использоваться другими плагинами, если значение остается `video`.','Adds a Special Offers textarea input. This can be used by other plugins if the htmlvar remains `special_offers`.'=>'Добавляет текстовое поле для специальных предложений. Это может использоваться другими плагинами, если значение поля остается `special_offers`.','Adds a schema price range input.'=>'Добавляет входные данные ценового диапазона схемы.','Select Price Range/'=>'Выберите диапазон цен/','Mark listing as a featured.'=>'Отметить объявление как рекомендованное.','No tab items have been added yet.'=>'Элементы вкладки еще не добавлены.','%s field already exists, it can not be used twice.'=>'Поле %s уже существует, его нельзя использовать дважды.','Field key name MUST be unique, duplicate field detected, please fix and re-save.'=>'Имя ключа поля ДОЛЖНО быть уникальным, обнаружено повторяющееся поле, исправьте и сохраните заново.','Field update failed.x'=>'Ошибка обновления поля. X','Select format of the email to send.'=>'Выберите формат электронного письма для отправки.','Upload a logo to be displayed at the top of the emails. Displayed on HTML emails only.'=>'Загрузите логотип, который будет отображаться в верхней части писем. Отображаетс