t 2'=>'Текст оценки 2 балла','This is the text shown when the star rating is selected.'=>'Этот текст отображается при выборе звезды рейтинга.','Rating text 3'=>'Текст оценки 3 балла','Rating text 4'=>'Текст оценки 4 балла','Rating text 5'=>'Текст оценки 5 баллов','Details page'=>'Детальная страница','Disable theme feature image output?'=>'Отключить вывод изображения функции темы?','This will try to disable the theme featured image output, this can be useful if you are seeing double images on the details page.'=>'Это попытается отключить вывод избранного изображения темы, это может быть полезно, если вы видите дубли изображений на странице объявления.','Page template file override'=>'Переопределение файла шаблона страницы','Select the page template to use for the details page output, usually this is set in the page template settings but you can override it here if needed.'=>'Выберите шаблон страницы, который будет использоваться для вывода страницы сведений, обычно это задается в настройках шаблона страницы, но при необходимости вы можете переопределить его здесь.','Listing submitted'=>'Объявление отправлено','Listing edited'=>'Объявление изменено','Moderate comment'=>'Комментарий модератора','Email Template'=>'Шаблон email','Rating color'=>'Цвет оценки','Sorting'=>'Сортировка','Automatic (recommended)'=>'Автоматически (рекомендуется)','Google Maps API'=>'Google Maps API','OpenStreetMap API'=>'OpenStreetMap API','Preparing export...'=>'Подготовка к экспорту...','Import/Export'=>'Импорт/экспорт','Site Settings'=>'Настройки сайта','Listing Settings'=>'Настройки объявлений','Map Settings'=>'Настройки карты','Tracking Settings'=>'Отслеживание использования','Allow Usage Tracking?'=>'Разрешить отслеживание использования?','Maps API'=>'API Карт','User deleted posts'=>'Удаленные сообщения пользователем','Allow posting without logging in?'=>'Разрешить размещение без входа в систему?','Show preview button?'=>'Показать кнопку предварительного просмотра?','If checked a preview 