n at which this post type will appear in post type list everywhere on the website.
	<b>Note: If the entered value is already an order of other post type then this will not make any effect.</b>'=>'Позиция, на которой этот тип поста будет появляться в списке типа поста везде на веб-сайте.
<b> Примечание: Если введенное значение уже заказ другого типа столба после этого, то это не сделает никакой эффект. </b>','Default image'=>'Изображение по умолчанию','General name for the post type, <b>Usually Plural.</b>'=>'Общее название для типа столба, <b> обычно множественное число. </b>','Singular name'=>'Уникальное имя','Name for one object of this post type. Defaults to value of name.'=>'Имя для одного объекта данного типа поста. По умолчанию используется значение name.','Add new'=>'Добавить новый','The add new text. The default is Add New for both hierarchical and non-hierarchical types.'=>'Добавить новый текст. Значение по умолчанию - Добавить Новый для иерархических и неиерархических категорий.','The add new item text. Default is Add New Post/Add New Page.'=>'Добавить текст нового элемента. По умолчанию это Добавить Новый Пост / Добавить Новую Страницу.','Edit item'=>'Редактировать','The edit item text. Default is Edit Post/Edit Page.'=>'Текст редактирования элемента. По умолчанию это Редактировать Пост / Редактировать Страницу.','New item'=>'Новый элемент','The new item text. Default is New Post/New Page.'=>'Текст нового элемента. По умолчанию это Новая Запись/Новая Страница.','View item'=>'Смотреть элемент','The view item text. Default is View Post/View Page.'=>'Текст просмотра элемента. По умолчанию - Просмотр записи / Просмотр страницы.','The search items text. Default is Search Posts/Search Pages.'=>'Текст поиска элементов. По умолчанию это Поиск Записей / Поиск страниц.','Not found'=>'Не найдено','The not found text. Default is No posts found/No pages found.'=>'Текст для ничего не найдено. По умолчанию Записи не найдены / Страницы не найдены.','Not found in trash'=>'Не найдено в корзине','The not found in trash text. Default is No posts found in Trash/No pages found in Trash.'=>'Текст - В корзине не найдено. По умолчанию: В корзине нет записей / Вкорзине нет страниц.','A short descriptive summary of what the post type is.'=>'Краткое описание типа поста.','Meta Title'=>'Мета Заголовок','Meta Description'=>'Мета описание','Details Page'=>'Страница сведений','Archive page'=>'Страница архива','Edit '=>'Редактировать ','New '=>'Новый ','Search '=>'Поиск ','No '=>'Нет','File upload limit'=>'Лимит загрузки файла','Set the date range, eg: 1920:2020 or for current dates: c-100:c+5'=>'Установите диапазон дат, например: 1920: 2020 или для текущих дат: c-100: c + 5','Upload default post type image.  This will be used in some areas if the listing has no image and the category has no default image.'=>'Загрузите изображение типа поста по умолчанию.  Это будет использоваться в некоторых областях, если в списке нет изображения, а в категории нет изображения по умолчанию.','The icon to be used in the admin menu from the post type.'=>'Значок, который будет использоваться в меню администратора из типа сообщения.','Disable ratings'=>'Отключить рейтинги','Disable review stars without disabling comments.'=>'Отключите звезды обзора, не отключая комментарии.','Disable favorites'=>'Отключить избранное','Disable favorites for this post type?'=>'Отключить избранное для этого типа сообщений?','Disable frontend add'=>'Отключить добавление внешнего интерфейса','Prevent this post type from being added from the frontend?'=>'Запретить добавление этого типа сообщений из внешнего интерфейса?','Author page'=>'Страница автора','Authors posts'=>'Посты авторов','Select the visibility of the authors posts on the authors posts url.'=>'Выберите видимость сообщений авторов по URL-адресу сообщений авторов.','Authors favorites'=>'Избранное авторов','Select the visibility of the authors favorites posts on the authors favorites url.'=>'Выберите видимость избранных сообщений авторов на URL-адресах избранных авторов.','SEO Overrides'=>'SEO переопределения','Main settings are set from the General>Titles & Meta settings, here you can override those per CPT.'=>'Основные настройки устанавливаются в General> Titles & Meta settings, здесь вы можете переопределить их для каждого CPT.','The page title will appear on the post type archive page.'=>'Заголовок страницы появится на странице архива типа сообщения.','Meta title will appear in head tag of this post type archive page.'=>'Мета-заголовок появится в заголовке страницы архива этого типа.','Meta description will appear in head tag of this post type archive page.'=>'Мета-описание появится в заголовке страницы архива этого типа.','Template Page Settings'=>'Настройки страницы шаблона','Template pages are used to design the respective pages and should never be linked to directly.'=>'Страницы-шаблоны используются для создания соответствующих страниц и никогда не должны быть связаны напрямую.','Select the page to use as the GD details page template'=>'Выберите страницу для использования в качестве шаблона страницы сведений о GD','Select the page to use for GD archives such as taxonomy and CPT pages'=>'Выберите страницу для использования в архивах GD, таких как страницы таксономии и CPT.м','Archive item page'=>'Страница архива элемента','Select the page to use for GD archive items, this is the item template used on taxonomy and CPT pages'=>'Выберите страницу для использования для элементов архива GD, это шаблон элемента, используемый на страницах таксономии и CPT.','Invalid or missing post type'=>'Неверный или отсутствующий тип сообщения','Post type already exists.'=>'Тип сообщения уже существует.','Post type slug already exists.'=>'Заголовок типа сообщения уже существует.','Menu icon'=>'Значок меню','Labels'=>'Этикетки','Private'=>'Личное','Add new item'=>'Добавить элемент','Public'=>'Публичное','Add New '=>'Добавить новое ','Default (%s)'=>'По умолчанию (%s)','Search items'=>'Поиск элементов','User'=>'Пользователь','Permissions'=>'Разрешения','Last access'=>'Последний доступ','API key'=>'API ключ','ID: %d'=>'ID: %d','Write'=>'Запись','Read/Write'=>'Чтение / Запись','Keys/Apps'=>'Ключи / Приложения','Add key'=>'Добавить ключ','Search key'=>'Ключ поиска','API key revoked successfully.'=>'Ключ API успешно отозван.','If you find a bug within GeoDirectory core you can create a ticket via <a href="%1$s">Github issues</a>. Ensure you read the <a href="%2$s">contribution guide</a> prior to submitting your report. To help us solve your issue, please be as descriptive as possible and include your <a href="%3$s">system status report</a>.'=>'Если вы обнаружили ошибку в ядре геоДиректа, вы можете создать тикет через <a href="%1$s"> GitHub вопросы</a>. Убедитесь, что вы читаете  <a href="%2$s"> руководство по взносам</a> до отправки отчета. Чтобы помочь нам решить вашу проблему, пожалуйста, будьте как можно более информативными и включите ваш <a href="%3$s"> отчет о состоянии системы </a>.','Report a bug'=>'Сообщить об ошибке','Setup wizard'=>'Мастер настройки','If you need to access the setup wizard again, please click on the button below.'=>'Если Вам нужно получить доступ к мастеру установки, пожалуйста, нажмите на кнопку ниже.','Running the wizard again will not delete your current settings. You will have the option to change any current settings.'=>'Запуск мастера снова не удалит текущие настройки. У вас будет возможность изменить любые текущие настройки.','Github project'=>'Проект Github','Official extensions'=>'Официальные Расширения','Cheating&#8217; huh?'=>'Хакер&#8217; что ли?','API Keys'=>'API ключи','API'=>'API','Keys'=>'Ключи','Enable the REST API'=>'Включить REST API','Post type'=>'Тип записи','The new post type system name ( max. 17 characters ). Lower-case characters and underscores only. Min 2 letters. Once added the post type system name cannot be changed. <b>Usually Singular.</b>'=>'Новое имя системы типа поста (Макс. 17 символов). Символы нижнего регистра и знаки подчеркивания. Минимум 2 буквы. После добавления имя системы типа POST не может быть изменено. <b> обычно сингулярные. </b>','The listing slug name ( max. 20 characters ). Alphanumeric lower-case characters and underscores and hyphen(-) only. Min 2 letters. <b>Usually Plural.</b>'=>'Имя пули списка (Макс. 20 символов). Буквенно-цифровые символы нижнего регистра и знаки подчеркивания и дефис (-). Минимум 2 буквы. <b> обычно множественное число. </b>','Revoke API key'=>'Отзыв ключа API','The GeoDirectory REST API allows to view and manage GD data through API. Access is granted only to those with valid API keys.'=>'API REST GeoDirectory позволяет просматривать и управлять данными GD через API. Доступ предоставляется только тем, у кого есть действующие ключи API.','Create an API key'=>'Создайте ключ API','About GeoDirectory'=>'О GeoDirectory','WordPress.org project'=>'Проект WordPress.org','Official themes'=>'Официальные темы','Order in post type list'=>'Порядок в списке типов сообщений','Post Type Settings'=>'Настройки типа записи','Slug'=>'Ярлык','For more information:'=>'Дополнительная информация:','Read'=>'Прочитано','Revoke'=>'Отозвать','Consumer key ending in'=>'Срок действия пользовательского ключа','View/Edit'=>'Просмотр/Правка','Help &amp; Support'=>'Помощь &amp; Поддержка','Should you need help understanding, using, or extending GeoDirectory, <a href="%s">please read our documentation</a>. You will find all kinds of resources including snippets, tutorials and much more.'=>'Если вам нужна помощь в понимании, использовании или расширении геоДиректа, <a href="%s"> пожалуйста, прочитайте нашу документацию </a>. Вы найдете все виды ресурсов, включая фрагменты, учебники и многое другое.','For further assistance with GeoDirectory core or with premium extensions sold by GeoDirectory you can open a <a href="%1$s">support ticket</a>.'=>'Для дальнейшей помощи с геоКаталогом Core или с премиум расширениями, продаваемыми геоДиректом, вы можете использовать наш <a href="%1$s"> поддержка форумов </a>.','Before asking for help we recommend checking the system status page to identify any problems with your configuration.'=>'Перед тем как обращаться за помощью, рекомендуется проверить состояние системы на соответствующей странице, с целью выявления